class B{static get inputProperties(){return["--a"]}paint(a,b,c){const d=parseFloat(c.get("--a").toString());300>d?(a.fillStyle=`hsl(${d+30}deg, 85%, 49%)`,a.fillRect(0,0,d/2,b.height),a.fillRect(b.width-d/2,0,b.width,b.height)):(a.fillStyle=`hsl(${d%30+15}deg, 85%, 49%)`,a.arc(b.width/2,b.height/2,19*Math.log(d-300)+5,0,2*Math.PI)),a.fill()}}registerPaint("b",B);